import React, { useState } from 'react';
import axios from 'axios';

const CreateTournamentForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    game: 'League of Legends',
    date: '',
    time: '',
    teams: [''],
    prizePool: '',
    organizer: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleTeamsChange = (index, value) => {
    const newTeams = [...formData.teams];
    newTeams[index] = value;
    setFormData({ ...formData, teams: newTeams });
  };

  const addTeam = () => {
    setFormData({ ...formData, teams: [...formData.teams, ''] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:3001/tournaments', formData);
      console.log('Tournament created successfully:', response.data);
    } catch (error) {
      console.error('Error creating tournament:', error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <h2>Create a Tournament</h2>

      <label>Tournament Name</label>
      <input
        type="text"
        name="name"
        value={formData.name}
        onChange={handleChange}
        required
      />

      <label>Game</label>
      <select name="game" value={formData.game} onChange={handleChange}>
        <option value="League of Legends">League of Legends</option>
        <option value="Valorant">Valorant</option>
        <option value="Fortnite">Fortnite</option>
        <option value="Call of Duty Warzone">Call of Duty Warzone</option>
        <option value="Apex Legends">Apex Legends</option>
        <option value="Overwatch 2">Overwatch 2</option>
        <option value="Rocket League">Rocket League</option>
        <option value="Counter-Strike 2">Counter-Strike 2</option>
        <option value="Rainbow Six Siege">Rainbow Six Siege</option>
      </select>

      <label>Date</label>
      <input
        type="date"
        name="date"
        value={formData.date}
        onChange={handleChange}
        required
      />

      <label>Time</label>
      <input
        type="time"
        name="time"
        value={formData.time}
        onChange={handleChange}
        required
      />

      <label>Teams</label>
      {formData.teams.map((team, index) => (
        <div key={index}>
          <input
            type="text"
            value={team}
            onChange={(e) => handleTeamsChange(index, e.target.value)}
            required
          />
        </div>
      ))}
      <button type="button" onClick={addTeam}>
        Add Team
      </button>

      <label>Prize Pool</label>
      <input
        type="number"
        name="prizePool"
        value={formData.prizePool}
        onChange={handleChange}
        required
      />

      <label>Organizer</label>
      <input
        type="text"
        name="organizer"
        value={formData.organizer}
        onChange={handleChange}
        required
      />

      <button type="submit">Create Tournament</button>
    </form>
  );
};

export default CreateTournamentForm;
